script: |
  super -f tsv -I q8664.sql | sort > q8664.out

vector: true

inputs:
  - name: q8664.sql
    data: |
      SELECT DISTINCT - COUNT ( * ) AS col2, - 59 AS col0 FROM ( tab0 AS cor0 CROSS JOIN tab2 AS cor1 );
  - name: tab0
  - name: tab2

outputs:
  - name: q8664.out
    data: |
      -9	-59
